import React from "react";

const Profile = () => {
  return (
    <div className="text-center mt-6">
      <img src="https://via.placeholder.com/150" alt="Profile" className="mx-auto rounded-full" />
      <h1 className="text-2xl mt-4">Your Profile</h1>
    </div>
  );
};

export default Profile;
